  false,\n\t\"url\": null,\n\t\"notes\": \"This global monthly precipitation analysis
  is called the Climate Prediction Center (CPC) Precipitation Reconstruction (PREC).
  This analysis consists of two components, the land analysis (PREC/L) and oceanic
  analysis (PREC/O). The land analysis is defined by interpolation of gauge observations
  from the Global Historical Climatology Network (GHCN) version 2, and the Climate
  Prediction Center Climate Anomaly Monitoring System (CAMS) dataset through the Optimal
  Interpolation (OI) algorithm. The oceanic analysis is defined by Empirical Orthogonal
  Function (EOF) reconstruction of historical gauge observation from islands and atolls
  and land. The output resolutions are 0.5deg, 1.0deg, and 2.5deg latitude/longitude
  for the PREC/L, and 2.5deg latitude/longitude for PREC/O. The analysis covers time
  period from 1948 to current and is updated on real time basis. The data set is available
  at format of ASCII and binary.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
